import React from 'react';
import Home from './Home';
import Skills from './Skills';
import Projects from './Projects';
import Certification from './Certification';
import Contact from './Contact';

const App = () =>{
    return(
        <>
        <div className="container-fluid">
        <Home/>
        <Skills/>
        <Projects></Projects>
        <Certification/>
        <Contact></Contact>
        </div>
        </>
    )
};

export default App;
